import React, { useState } from 'react';
import "./formStyle.css"
import { Link,useNavigate } from "react-router-dom";
//https://localhost:7079/api/User/login?username=${formData.username}&password=${formData.password} <------------login request


const LoginForm = () => {
  const  navigate=useNavigate();
  const [formData, setFormData] = useState({
    username: "",
    password: "",
  });
  const [error, setError] = useState(null);

  const handleInputChange = (event) => {
    setFormData({
      ...formData,  
      [event.target.name]: event.target.value,
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    fetch('https://your-api-endpoint.com/login', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(formData)
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.status === 'success') {
          // Handle successful login
        } else {
          // Handle failed login
        }
      })
      .catch((error) => {
        // Handle error
      });
  };
  return (
    <div class="container">
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        name="username"
        placeholder="Username"
        value={formData.username}
        onChange={handleInputChange}
      />
      <input
        type="password"
        name="password"
        placeholder="Password"
        value={formData.password}
        onChange={handleInputChange}
      />
      <button type="submit">Login</button>
      <Link to='/RegisterForm'>Don't have an account?</Link>
      <p>temp:</p>
      <Link to='/CarGrid'>as</Link>
      <Link to='/CarsTest'>as</Link>
      <Link to='/UserList'>as</Link>

      
    </form>
    </div>
  );
};

export default LoginForm;
